var app = {};

app.modalView = Backbone.View.extend({

    className: 'modal-holder',

    template: TEMPLATES['tmp/modalView.hbs'],

    initialize: function (options) {
        var _this = this;

        _this.options = options || {};

        _this.on('postRender', _this.postRender);
        _this.listenTo(Backbone, 'editSwipe', _this.editSwipeAction);
    },

    render: function () {
        var _this = this;
        _this.$el.append(_this.template(_this.model.toJSON()));

        _this.trigger('postRender');
        return this;
    },

    postRender: function () {
        var _this = this;

        _this.$el.find('.modal').modal({
            show: false
        });
    },

    editSwipeAction: function (e) {
        var _this = this,
            id = e.attr('data-id'),
            dataType = e.attr('data-data_type').toLowerCase();

        app.currently_swiping = true;
        setTimeout(function(){
            app.currently_swiping = false;
        }, 300);
        this.activeListItem = e;

        if (dataType === 'no_contacts_assigned') {
            var opp = _.filter(_this.model.get('fix_me_data')[dataType], function (obj) {
                    return obj.opp.id === id;
                })[0],
                $modal = _this.$el.find('.assign-contact'),
                $select = $modal.find('.list-group'),
                contacts = _this.model.get('choices_data').account_contacts[opp.opp.account_id],
                html = '';

            _.each(contacts, function (value, index) {
                html += '<li class="list-group-item" data-id="' + value.id + '">' + value.name + '<span class="small" style="display: block;color: #999;">' + value.role + '</span></li>';
            });

            $select.html(html);
            $modal.attr('data-opp-id', id);
            $modal.modal('show');
            $modal.css('margin-top', jQuery(e).offset().top+'px');

            _this.delegateEvents();

        } else if (dataType === 'assigned_to_invalid_stage') {
            var opp = _.filter(_this.model.get('fix_me_data')[dataType], function (obj) {
                    return obj.opp.id === id;
                })[0],
                $modal = _this.$el.find('.fix-stage'),
                $select = $modal.find('select'),
                stages = _this.model.get('choices_data').stages,
                html = '';

            _.each(stages, function (value, index) {
                html += '<option value="' + value + '">' + value + '</option>';
            });

            $select.html(html);
            $modal.attr('data-opp-id', id);
            $modal.modal('show');
            $modal.css('margin-top', jQuery(e).offset().top+'px');

            _this.delegateEvents();

        } else if (dataType === 'close_date_not_realistic_based_off_current_stage' ||
            dataType === 'expected_close_date_past') {

            var opp = _.filter(_this.model.get('fix_me_data')[dataType], function (obj) {
                    return obj.opp.id === id;
                })[0],
                $modal = _this.$el.find('.fix-close-date');


            var today = new Date(),
                day = today.getDate(),
                month = today.getMonth() + 1,
                year = today.getFullYear();

            if (day < 10) {
                day = '0' + day
            }

            if (month < 10) {
                month = '0' + month
            }
            today = year + '-' + month + '-' + day;

            $modal.find('input').val(opp.opp.expected_close_date);

            $modal.attr('data-opp-id', id);
            $modal.modal('show');
            $modal.css('margin-top', jQuery(e).offset().top+'px');

        } else if (dataType === 'open_task_due_in_past') {
            var opp = _.filter(_this.model.get('fix_me_data')[dataType], function (obj) {
                    return obj.opp.id === id;
                })[0],
                $modal = _this.$el.find('.fix-task'),
                $select = $modal.find('select'),
                stages = _this.model.get('choices_data').task_status,
                html = '';

            _.each(stages, function (value, index) {
                html += '<option value="' + value + '">' + value + '</option>';
            });

            var today = new Date(),
                day = today.getDate(),
                month = today.getMonth() + 1,
                year = today.getFullYear();

            if (day < 10) {
                day = '0' + day
            }

            if (month < 10) {
                month = '0' + month
            }
            today = year + '-' + month + '-' + day;

            $modal.find('input').val(today);

            $select.html(html);
            $modal.attr('data-opp-id', opp.task_data.id);
            $modal.modal('show');
            $modal.css('margin-top', jQuery(e).offset().top+'px');
        }

        app.skip_next_click = true;
    },

    events: {
        'click .list-group-item': 'activateListItem',
        'click [data-action="submitFixStage"]': 'submitFixStage',
        'click [data-action="submitContactModal"]': 'submitContactModal',
        'click [data-action="submitEditTask"]': 'submitEditTask',
        'click [data-action="submitNewCloseDate"]': 'submitNewCloseDate'
    },

    activateListItem: function (e) {
        var _this = this,
            $this = $(e.target);

        if ($this.hasClass('single')) {
            $this.siblings().removeClass('active')
            $this.addClass('active');
        } else {
            $this.toggleClass('active');
        }

    },

    submitContactModal: function (e) {
        var _this = this,
            $this = $(e.target),
            $modal = $this.closest('.modal'),
            ids = [];

        $modal.find('.list-group-item.active').each(function (index, el) {
            ids.push($(this).attr('data-id'));
        });
        $modal.modal('hide');

        jQuery(_this.activeListItem).find('li:nth-child(3) .control').html('<span style="margin-right:7px;">Opportunity contacts updated!</span>');
        setTimeout(function () {
            jQuery(_this.activeListItem).slideUp({
                done: function () {
                    $(this).remove();
                }
            });
        }, 4000);
        $.ajax({
            type: 'POST',
            url: '/update_opp_contacts/'+$modal.attr('data-opp-id')+'/',
            data: {
                json_data: JSON.stringify(ids)
            },
            success: function (data, status, xhr) {
                if (data) {
                    console.log('saved opp contacts', data);
                }
            },
            error: function (xhr, type, exception) {
                console.log('ajax error response type ' + type, arguments);
            }
        });
    },

    submitFixStage: function (e) {
        var _this = this,
            $this = $(e.target),
            $modal = $this.closest('.modal'),
            id = $modal.find('select').val();

        $modal.modal('hide');
        jQuery(_this.activeListItem).slideUp();
        $.ajax({
            type: 'POST',
            url: '/update_opp_stage/'+$modal.attr('data-opp-id')+'/',
            data: {
                stage: id
            },
            success: function (data, status, xhr) {
                if (data) {
                    console.log('saved opp contacts', data);
                }
            },
            error: function (xhr, type, exception) {
                console.log('ajax error response type ' + type, arguments);
            }
        });

    },

    submitNewCloseDate: function (e) {
        var _this = this,
            $this = $(e.target),
            $modal = $this.closest('.modal'),
            value = $modal.find('input').val();

        $modal.modal('hide');
        jQuery(_this.activeListItem).find('li:nth-child(3) .control').html('<span style="margin-right:7px;">Close date set to ' + value + '!</span>');
        setTimeout(function () {
            jQuery(_this.activeListItem).slideUp({
                done: function () {
                    $(this).remove();
                }
            });
        }, 4000);
        $.ajax({
            type: 'POST',
            url: '/update_expected_close_date/'+$modal.attr('data-opp-id')+'/',
            data: {
                expected_close_date: value
            },
            success: function (data, status, xhr) {
                if (data) {
                    console.log('saved opp contacts', data);
                }
            },
            error: function (xhr, type, exception) {
                console.log('ajax error response type ' + type, arguments);
            }
        });

    },

    submitEditTask: function (e) {
        var _this = this,
            $this = $(e.target),
            $modal = $this.closest('.modal'),
            date = $modal.find('input').val(),
            state = $modal.find('select').val();


        $modal.modal('hide');

        jQuery(_this.activeListItem).find('li:nth-child(3) .control')
            .html('<span style="margin-right:7px;">Task due date set to ' + date + ' and status set to ' + state + '!</span>');
        setTimeout(function () {
            jQuery(_this.activeListItem).slideUp({
                done: function () {
                    $(this).remove();
                }
            });
        }, 4000);

        $.ajax({
            type: 'POST',
            url: '/update_task/'+$modal.attr('data-opp-id')+'/',
            data: {
                status: state,
                due_date: date
            },
            success: function (data, status, xhr) {
                if (data) {
                    console.log('saved opp contacts', data);
                }
            },
            error: function (xhr, type, exception) {
                console.log('ajax error response type ' + type, arguments);
            }
        });

    }

});
app.mainView = Backbone.View.extend({

    template: TEMPLATES['tmp/mainView.hbs'],

    initialize: function (options) {
        var _this = this;

        _this.options = options || {};

        if (_this.options.modalView) {
            _this.modalView = _this.options.modalView;
        }

        app.skip_next_click = true;
        _this.on('postRender', _this.postRender);
        _this.listenTo(Backbone, 'defaultSwipe', _this.defaultSwipeAction);
        _this.listenTo(Backbone, 'onPage', _this.setHeights);
    },

    render: function () {
        var _this = this;

        if (_this.model) {
            _this.$el.empty().append(this.template(_this.model.toJSON()));
        }

        _this.trigger('postRender');

        return _this;
    },

    events: {
        'click .opp-container': 'openOppProfile',
        'click .opp-profile-opener': 'openOppProfile'
    },

    postRender: function () {
        var _this = this;

        _this.$el.find('.carousel').css({width: ($(window).width() - 30) + 'px'});
        _this.$el.find('.carousel').each(function () {
            var dataId = $(this).attr('data-id_'),
                carousel = new Carousel('[data-id_="' + dataId + '"]', _this);

            carousel.init();
        });
    },

    defaultSwipeAction: function (e) {
        var _this = this,
            id = e.attr('data-id'),
            dataType = e.attr('data-data_type').toLowerCase();

        app.currently_swiping = true;
        setTimeout(function(){
            app.currently_swiping = false;
        }, 300);

        this.activeListItem = e;

        if (dataType === 'no_contacts_assigned') {
            var opp = _.filter(_this.model.get('fix_me_data')[dataType], function (obj) {
                    return obj.opp.id === id;
                })[0],
                account_id = opp.opp.account_id,
                contacts = _this.model.get('choices_data').account_contacts[account_id],
                ids = [];

            _.each(contacts, function (value, index) {
                ids.push(value.id);
            });

            e.find('li:nth-child(1) .control').html('<span style="margin-right:7px;">Added all account contacts!</span>');
            setTimeout(function () {
                e.slideUp({
                    done: function () {
                        $(this).remove();
                    }
                });
            }, 4000);

            $.ajax({
                type: 'POST',
                url: '/update_opp_contacts/'+e.attr('data-id')+'/',
                data: {
                    json_data: JSON.stringify(ids)
                },
                success: function (data, status, xhr) {
                    if (data) {
                        console.log('saved opp contacts', data);
                    }
                },
                error: function (xhr, type, exception) {
                    console.log('ajax error response type ' + type, arguments);
                }
            });

        } else if (dataType === 'assigned_to_invalid_stage') {
            var opp = _.filter(_this.model.get('fix_me_data')[dataType], function (obj) {
                    return obj.opp.id === id;
                })[0];

            e.find('li:nth-child(1) .control').html('<span style="margin-right:7px;">Stage updated to ' + opp.default + '!</span>');
            setTimeout(function () {
                e.slideUp({
                    done: function () {
                        $(this).remove();
                    }
                });
            }, 4000);

            $.ajax({
                type: 'POST',
                url: '/update_opp_stage/'+e.attr('data-id')+'/',
                data: {
                    stage: opp.default
                },
                success: function (data, status, xhr) {
                    if (data) {
                        console.log('saved opp contacts', data);
                    }
                },
                error: function (xhr, type, exception) {
                    console.log('ajax error response type ' + type, arguments);
                }
            });

        } else if (dataType === 'close_date_not_realistic_based_off_current_stage' ||
            dataType === 'expected_close_date_past') {

            var opp = _.filter(_this.model.get('fix_me_data')[dataType], function (obj) {
                return obj.opp.id === id;
            })[0];

            e.find('li:nth-child(1) .control').html('<span style="margin-right:7px;">Expected close date set to ' + opp.default + '!</span>');
            setTimeout(function () {
                e.slideUp({
                    done: function () {
                        $(this).remove();
                    }
                });
            }, 4000);

            $.ajax({
                type: 'POST',
                url: '/update_expected_close_date/'+e.attr('data-id')+'/',
                data: {
                    expected_close_date: opp.default
                },
                success: function (data, status, xhr) {
                    if (data) {
                        console.log('saved opp contacts', data);
                    }
                },
                error: function (xhr, type, exception) {
                    console.log('ajax error response type ' + type, arguments);
                }
            });
        } else if (dataType === 'open_task_due_in_past') {
            var opp = _.filter(_this.model.get('fix_me_data')[dataType], function (obj) {
                    return obj.opp.id === id;
                })[0];

            e.find('li:nth-child(1) .control').html('<span style="margin-right:7px;">Task marked complete!</span>');
            setTimeout(function () {
                e.slideUp({
                    done: function () {
                        $(this).remove();
                    }
                });
            }, 4000);

            $.ajax({
                type: 'POST',
                url: '/update_task/'+opp.task_data.id+'/',
                data: {
                    status: opp.default
                },
                success: function (data, status, xhr) {
                    if (data) {
                        console.log('saved opp contacts', data);
                    }
                },
                error: function (xhr, type, exception) {
                    console.log('ajax error response type ' + type, arguments);
                }
            });
        }
    },

    openOppProfile: function (e) {
        var _this = this,
            $el = $(e.target).closest('.opp-profile-opener'),
            dataId = $el.attr('data-id');


        setTimeout(function(){
            if (!app.currently_swiping) {
                parent.postMessage({"url":"/"+dataId}, '*');
            }
        }, 200);

    },

    setHeights: function () {
        //parent.postMessage({"resize":jQuery('.modal-holder').offset().top}, '*');
        
        this.$el.find('.carousel').each(function (index, el) {
            var h = $(this).find('li:nth-child(2)').outerHeight();
            $(this).find('li:nth-child(1)').css({height: h + 'px'});
            $(this).find('li:nth-child(3)').css({height: h + 'px'});
        })
    }

});

app.AppRouter = Backbone.Router.extend({

    routes: {
        '': 'fix',
        'fix': 'fix_'
    },

    initialize: function () {
        //app.slider = new PageSlider($('#page_slider'));

        this.$appTarget = $('.app-target');
        this.previousView = undefined;
        this.currentView = undefined;

        var _this = this;
        _this.listenTo(Backbone, 'pageDone', function () {
            if (_this.previousView instanceof Backbone.View) {

                if (_this.previousView.subViews) {
                    _this.killSubViews(_this.previousView);
                }
                _this.killView(_this.previousView);
                _this.previousView = undefined;
            }
        });

    },

    killView: function (_view) {

        _view.stopListening();
        _view.undelegateEvents();
        _view.remove();

    },

    killSubViews: function (_view) {
        var _this = this;
        _.each(_view.subViews, function (view, index) {
            if (view.subViews) {
                _this.killSubViews(view);
            }
            _this.killView(view);
        });
    },

    fix_: function () {

        if (app.ALLTHEDATA) {

        }
        var data = new Backbone.Model(app.ALLTHEDATA),
            _modalView = new app.modalView({
                model: data
            }).render(),

            _view = new app.mainView({
                model: data,
                modalView: _modalView
            }).render();

        _view.$el.append(_modalView.$el);

        this.currentView = _view;
        this.$appTarget
            .empty()
            .append(_view.$el);
        Backbone.trigger('onPage');
    }
});
